import React from "react";
import { Link } from "react-router-dom";

const Menu = () => {
  return (
    <>
      <Link> About us </Link>
      <Link>Contact us </Link>
      <br />
      <br />
      <a href="">About us</a>
      <a href="">Contact us</a>
    </>
  );
};

export default Menu;
